import { useEffect, useState } from "react";
import "../scss/ban.css";
import $ from "jquery";

export default function Circle(){
    function chg_page(){
        const circle = $(".album_set");
        console.log(circle)

    }
    
    let [ num , setNum] = useState(0)

    useEffect(()=>{
        const circle = $(".album_set").on("click", chg_page)
    
    },[])
    
    return(
        <>
            <div className="circle_wrapper">
                <div className="circle"></div>
            </div>
            {/* {chg_page()} */}
        </>
    )
}
